import React from 'react';
import './App.css';
import {fetchReasons} from './services/ReasonServices';

class App extends React.Component {

  constructor(props) {
    super(props);
    this.state= {
      data: []
    }
    this.fetchNewPeople = this.fetchNewPeople.bind(this);
  } 

  fetchNewPeople() {
    fetchReasons()
      .then(data => {
        this.setState ({
          data: data
        })
      })

  }

 render() {

   return (
     <div className="App">
        {this.state.data}
     </div>
   );
 }


}

export default App;
